import React, { Component } from "react";
import gif from "../../assets/hero.gif";
import "../../styles.css";
import { NavLink } from "react-router-dom";

class Home extends Component {
    render (){
        return (
            <div className="home">
                <section className="p-4">
                    <div className="container pt-5">
                    <h4 className="text-white">WHY CODE ALONE <span>when</span> YOU CAN GO ON A CODEDATE &hearts;</h4>
                    <p>
                    </p>
                    <a className="text-white" href="https://github.com/digvijaysrathore/novacafe">@Github</a>
                    </div>
                </section>
                <section className="p-4 bg-white">
                    <div className="container">
                    <h4 className="text-white">&#128512;MEET YOUR CO-FOUNDER</h4>
                    <p className="text-white">Meet like minded people in the cafe, who want to build that next big thing with you.</p>
                    <p className="text-white">Join The Cafe</p>
                    <p className="text-white">Browse Profiles</p>
                    <p className="text-white">Talk To 'em!</p>
                    </div>
                </section>
            </div>
        )
    }
}

export default Home;
